INSERT INTO `celrcomments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2023-05-18 15:22:20', '2023-05-18 15:22:20', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://en.gravatar.com/\">Gravatar</a>.', 0, 'post-trashed', '', 'comment', 0, 0),
(2, 15920, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2018-08-15 11:50:35', '2018-08-15 11:50:35', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\" rel=\"nofollow ugc\">Gravatar</a>.', 0, 'post-trashed', '', 'comment', 0, 0),
(3, 334, 'Mr. Mackay', 'zak@asda.as', '', '176.98.70.114', '2021-08-27 13:51:21', '2021-08-27 13:51:21', 'I’ve heard the argument that “lorem ipsum” is effective in wireframing or design because it helps people focus on the actual layout, or color scheme, or whatever. What kills me here is that we’re talking about creating a user experience that will (whether we like it or not) be DRIVEN by words.', 0, '1', '', 'review', 0, 0),
(4, 344, 'Mr. Mackay', 'zak@asda.as', '', '176.98.70.114', '2021-08-27 13:51:46', '2021-08-27 13:51:46', 'Using dummy content or fake information in the Web design process can result in products with unrealistic assumptions and potentially serious design flaws. A seemingly elegant design can quickly begin to bloat with unexpected content or break under the weight of actual activity.', 0, '1', '', 'review', 0, 0),
(5, 361, 'Mr. Mackay', 'zak@asda.as', '', '176.98.70.114', '2021-08-27 13:52:07', '2021-08-27 13:52:07', 'If the copy becomes distracting in the design then you are doing something wrong or they are discussing copy changes. It might be a bit annoying but you could tell them that that discussion would be best suited for another time. At worst the discussion is at least working towards the final goal of your site where questions about lorem ipsum don’t.', 0, '1', '', 'review', 0, 0);
