(3075, 15959, '_elementor_data', '[{\"id\":\"ab4ab1d\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"55df336\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"f14d410\",\"elType\":\"widget\",\"settings\":{\"text\":\"<h3>IMPERDIET HIMENAEOS MATTIS<\\/h3><p>A a at habitasse inceptos a quisque nibh ut arcu et dictum laoreet elit ante scelerisque libero consectetur erat non a suspendisse ad phasellus phasellus suspendisse gravida eu. Dapibus congue libero sem at dis a a adipiscing parturient eros diam parturient sodales consectetur quis.<\\/p><blockquote><p>Consequat blandit a ullamcorper vestibulum feugiat eu a parturient ante at facilisi suscipit quis gravida tempor fringilla etiam dolor id suspendisse adipiscing natoque scelerisque es vivamus sed massa.<\\/p><\\/blockquote><p>A sodales hac dolor parturient tincidunt dictumst a condimentum nunc auctor parturient a nibh dis a vestibulum arcu a a. Urna rhoncus eleifend parturient condimentum et vulputate nunc.\\u00a0Ut dolor condimentum hendrerit non mattis a commodo sociis mi nec rutrum parturient litora.<\\/p>\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"wd_text_block\"}],\"isInner\":false},{\"id\":\"70db5d1\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"87753bb\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/celr.co.uk\\/wp-content\\/uploads\\/2021\\/08\\/wooden-single-drawer-2-1.jpg\",\"id\":391,\"alt\":\"\",\"source\":\"library\"},\"image_size\":\"full\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"wd_image_or_svg\"}],\"isInner\":false}],\"isInner\":false}]'),
