(4271, 16085, '_elementor_data', '[{\"id\":\"cbec501\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1393958\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"9327505\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Selling with Celr is simple. Just begin typing below and we\\u2019ll add the relevant details.<\\/p>\",\"text_columns\":\"1\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":21,\"sizes\":[]},\"typography_font_weight\":\"400\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"0cc3614\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\"},\"elements\":[{\"id\":\"6b6a993\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":25.988,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[],\"isInner\":false},{\"id\":\"a31e426\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":47.687,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"9f19d9f\",\"elType\":\"widget\",\"settings\":{\"placeholder\":\"I\\u2019d like to sell...\",\"button_text\":\"Search\",\"input_background_color\":\"#FFFFFF\",\"input_border_color\":\"#FE5757\",\"button_border_width\":{\"unit\":\"px\",\"top\":\"2\",\"right\":\"2\",\"bottom\":\"2\",\"left\":\"2\",\"isLinked\":true},\"border_radius\":{\"unit\":\"px\",\"size\":10,\"sizes\":[]},\"button_background_color\":\"#FFFFFF\",\"scroll_y\":-80,\"__globals__\":{\"input_background_color\":\"\",\"button_text_color\":\"globals\\/colors?id=secondary\"},\"input_box_shadow_box_shadow_type\":\"yes\",\"input_box_shadow_box_shadow\":{\"horizontal\":77,\"vertical\":0,\"blur\":\"\",\"spread\":0,\"color\":\"rgba(0, 0, 0, 0.92)\"}},\"elements\":[],\"widgetType\":\"search-form\"},{\"id\":\"f45f58e\",\"elType\":\"widget\",\"settings\":{\"custom_php\":\"if (isset($_GET[\'product_id\'])) {\\r\\n    $product_id = intval($_GET[\'product_id\']);\\r\\n    echo do_shortcode(\'[vendor_form product_id=\' . $product_id . \']\');\\r\\n} else {\\r\\n    \\/\\/ Display product search form\\r\\n    if (isset($_GET[\'product_search\'])) {\\r\\n        $product_search = sanitize_text_field($_GET[\'product_search\']);\\r\\n        $products = new WP_Query(array(\\r\\n            \'post_type\' => \'product\',\\r\\n            \'s\' => $product_search,\\r\\n            \'posts_per_page\' => -1,\\r\\n        ));\\r\\n\\r\\n        if ($products->have_posts()) {\\r\\n            while ($products->have_posts()) : $products->the_post();\\r\\n                $product_id = get_the_ID();\\r\\n                ?>\\r\\n                <a href=\\\"<?php echo esc_url(add_query_arg(\'product_id\', $product_id)); ?>\\\">\\r\\n                    <?php echo get_the_title(); ?>\\r\\n                <\\/a>\\r\\n                <br>\\r\\n                <?php\\r\\n            endwhile;\\r\\n        } else {\\r\\n            echo \'No products found.\';\\r\\n        }\\r\\n\\r\\n        wp_reset_postdata();\\r\\n    } else {\\r\\n        \\/\\/ Display the search form\\r\\n        ?>\\r\\n        <div class=\\\"elementor-widget-container\\\">\\r\\n\\t\\t\\t<link rel=\\\"stylesheet\\\" href=\\\"http:\\/\\/localhost:8080\\/celr\\/wp-content\\/plugins\\/elementor-pro\\/assets\\/css\\/widget-theme-elements.min.css\\\">\\t\\t<form class=\\\"elementor-search-form\\\" role=\\\"search\\\" action=\\\"http:\\/\\/localhost:8080\\/celr\\\" method=\\\"get\\\">\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t<div class=\\\"elementor-search-form__container\\\">\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t<input placeholder=\\\"I\\u2019d like to sell...\\\" class=\\\"elementor-search-form__input\\\" type=\\\"search\\\" name=\\\"s\\\" title=\\\"Search\\\" value=\\\"\\\">\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t<button class=\\\"elementor-search-form__submit\\\" type=\\\"submit\\\" title=\\\"Search\\\" aria-label=\\\"Search\\\">\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t<i aria-hidden=\\\"true\\\" class=\\\"fas fa-search\\\"><\\/i>\\t\\t\\t\\t\\t\\t\\t<span class=\\\"elementor-screen-only\\\">Search<\\/span>\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t<\\/button>\\r\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t<\\/form>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n        <?php\\r\\n    }\\r\\n}\\r\\n\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"dce-rawphp\"}],\"isInner\":false},{\"id\":\"d67c092\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":25.964,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"0ff7241\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"b61bbe5\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"87a8b68\",\"elType\":\"widget\",\"settings\":{\"title\":\"<span data-metadata=\\\"<!--(figmeta)eyJmaWxlS2V5IjoiSnFNbmd2SE9OaWpGY2t4YVprTkxwayIsInBhc3RlSUQiOjIwMTcwODMyMjMsImRhdGFUeXBlIjoic2NlbmUifQo=(\\/figmeta)-->\\\"><\\/span><span data-buffer=\\\"<!--(figma)ZmlnLWtpd2kZAAAAfDkAALWdaZxkS1XgI25m1tLVy9t39n317Tx2crlVmd25vbyZVd1PfElW5a2upLMyk7xZ3a8ZF0REREREREVERERERERERERERERERERURAbRcRyGcRzHUcdx5n8i4t68Wd2PmS\\/Dj9dx4sSJE9s5J06ciLz1z7oWRlHvbNi+OAmVuupko1LvBu18q634X71R8rvFcr6+4QdkdSfwW6m8Z6j9egk4E1Q26vkqUDZon6n6ADkDdANfeC0ZWsO5G5yqNLstv9rIS83leqNdWT\\/TDcqNTrXU7TQ3WvmS1F9xYLfUqEt+Nc63\\/PWWH5RBHQmKft3vgm6Wu\\/d2\\/NYZkGtpZMtvVgV5tFRZXyc9VqxW\\/Hq7W2jRejEfSN+Op\\/p2stFpMQ5fenYiaLf8fM2WkL\\/C5e2Ir8w\\/MIiYhNPASprQ+Z0dJhMUVKVuo24aViaz1aq0ZQy6Pu6Hzb1eFEJWpKhtWoKo1tg0oN4ajPqD0dnWwVBo6o36fX6rQYFqlEy5cLCr9XAKfVCq1Ch2aowKUBfz9c18AORttBqdJkBmvZWvCV220GhU\\/Xy922j6rXy70qiDzG36xXajBbQk4yRdrlYM2xW\\/Wq00AwFXWxCx7GZdj7T8jU413+o2G9UzG4bJGk3VS36J6Z7THW37p6VLx4JqpSiI48GZWqEhMnKiUqexusEyq5XiKZmqK4Nyvul3tyrtctfVvarYqNfh