(4287, 16090, '_elementor_data', '[{\"id\":\"cbec501\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1393958\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"9327505\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Selling with Celr is simple. Just begin typing below and we\\u2019ll add the relevant details.<\\/p>\",\"text_columns\":\"1\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":21,\"sizes\":[]},\"typography_font_weight\":\"400\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"0cc3614\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\"},\"elements\":[{\"id\":\"6b6a993\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":25.988,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[],\"isInner\":false},{\"id\":\"a31e426\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":47.687,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"9f19d9f\",\"elType\":\"widget\",\"settings\":{\"placeholder\":\"I\\u2019d like to sell...\",\"button_text\":\"Search\",\"input_background_color\":\"#FFFFFF\",\"input_border_color\":\"#FE5757\",\"button_border_width\":{\"unit\":\"px\",\"top\":\"2\",\"right\":\"2\",\"bottom\":\"2\",\"left\":\"2\",\"isLinked\":true},\"border_radius\":{\"unit\":\"px\",\"size\":10,\"sizes\":[]},\"button_background_color\":\"#FFFFFF\",\"scroll_y\":-80,\"__globals__\":{\"input_background_color\":\"\",\"button_text_color\":\"globals\\/colors?id=secondary\"},\"input_box_shadow_box_shadow_type\":\"yes\",\"input_box_shadow_box_shadow\":{\"horizontal\":77,\"vertical\":0,\"blur\":\"\",\"spread\":0,\"color\":\"rgba(0, 0, 0, 0.92)\"}},\"elements\":[],\"widgetType\":\"search-form\"},{\"id\":\"f45f58e\",\"elT