"}},\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false},{\"id\":\"77723ea\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"a745b1a\",\"elType\":\"widget\",\"settings\":{\"text\":\"<p>2<\\/p>\",\"text_color_scheme\":\"light\",\"text_alignment\":\"center\",\"width\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]},\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":44,\"sizes\":[]},\"_z_index\":999,\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"wd_text_block\"},{\"id\":\"842cb37\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":130,\"sizes\":[]},\"space_tablet\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"space_mobile\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"_element_width\":\"initial\",\"_element_custom_width\":{\"unit\":\"%\",\"size\":21,\"sizes\":[]},\"_position\":\"absolute\",\"_offset_x\":{\"size\":175,\"unit\":\"px\"},\"_offset_y\":{\"size\":-17,\"unit\":\"px\"},\"scroll_y\":-80,\"_background_background\":\"classic\",\"_border_border\":\"solid\",\"_border_width\":{\"unit\":\"px\",\"top\":\"1\",\"right\":\"1\",\"bottom\":\"1\",\"left\":\"1\",\"isLinked\":true},\"_border_radius\":{\"unit\":\"%\",\"top\":\"50\",\"right\":\"50\",\"bottom\":\"50\",\"left\":\"50\",\"isLinked\":true},\"_border_radius_tablet\":{\"unit\":\"%\",\"top\":\"\",\"right\":\"\",\"bottom\":\"\",\"left\":\"\",\"isLinked\":true},\"_border_radius_mobile\":{\"unit\":\"%\",\"top\":\"\",\"right\":\"\",\"bottom\":\"\",\"left\":\"\",\"isLinked\":true},\"_mask_switch\":\"yes\",\"__globals__\":{\"_border_color\":\"globals\\/colors?id=primary\",\"_background_color\":\"globals\\/colors?id=primary\"}},\"elements\":[],\"widgetType\":\"spacer\"},{\"id\":\"5359629\",\"elType\":\"widget\",\"settings\":{\"text\":\"<p>Upload your wines with 3 simple clicks.<\\/p>\",\"text_alignment\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":20,\"sizes\":[]},\"typography_font_weight\":\"600\",\"text_color\":\"title\",\"scroll_y\":-80,\"__globals__\":{\"typography_typography\":\"\"}},\"elements\":[],\"widgetType\":\"wd_text_block\"}],\"isInner\":false},{\"id\":\"ffdaa1b\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"c80249d\",\"elType\":\"widget\",\"settings\":{\"text\":\"<p>3<\\/p>\",\"text_color_scheme\":\"light\",\"text_alignment\":\"center\",\"width\":{\"unit\":\"px\",\"size\":66,\"sizes\":[]},\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":44,\"sizes\":[]},\"_z_index\":999,\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"wd_text_block\"},{\"id\":\"7be1c2f\",\"elType\":\"widget\",\"settings\":{\"text\":\"<p>When your wine sells, transfer ownership and get paid.<\\/p>\",\"text_alignment\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":20,\"sizes\":[]},\"typography_font_weight\":\"600\",\"text_color\":\"title\",\"scroll_y\":-80,\"__globals__\":{\"typography_typography\":\"\"}},\"elements\":[],\"widgetType\":\"wd_text_block\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a75292d\",\"elType\":\"section\",\"settings\":{\"dce_visibility_logical_connective\":\"and\"},\"elements\":[{\"id\":\"5d09d05\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"fff6921\",\"elType\":\"widget\",\"settings\":{\"title\":\"FAQ\",\"align\":\"center\",\"scroll_y\":-80,\"__globals__\":{\"title_color\":\"globals\\/colors?id=text\"}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"432b38f\",\"elType\":\"widget\",\"settings\":{\"text\":\"<h4>How much will selling with Celr cost me?<\\/h4><p>We take no commission on any sales. The only cost when selling comes from transaction fees and transfer fees incurred when transferring ownership between bonded warehouses. This will vary depending on which warehouse you and the seller use, but is generally around \\u00a315 per case. See more on transfer prices here.<\\/p><p>Transaction fees are 1.2% + 20p.<\\/p><h4>Can I sell any wine with Celr?<\\/h4><p>All wine sold on the Celr platform must be in-bond. This is to ensure condition and provenance for the buyer, and add conformity to the pricing.<\\/p><h4>Can I set my own price?<\\/h4><p>Celr provides a market price - this is a guideline price based on what the wine has sold for recently. We will also let you know what the lowest live offer for your wine is. You can then decide how much you would like to list for. We don\\u2019t allow listings of 10% above market price.<\\/p><h4>What happens when my wine sells?<\\/h4><p>We\\u2019ll notify you by email. The money is held by us for 15 days, during which time you will need to process the change of ownership with your warehouse provider. Once the buyer has confirmed receipt of ownership, we will release the money to you.<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":17,\"sizes\":[]},\"_padding\":{\"unit\":\"px\",\"top\":\"18\",\"right\":\"18\",\"bottom\":\"18\",\"left\":\"18\",\"isLinked\":true},\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"wd_text_block\"}],\"isInner\":false}],\"isInner\":false}]'),
