(4388, 16102, '_elementor_data', '[{\"id\":\"cbec501\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1393958\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"9327505\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Selling with Celr is simple. Just begin typing below and we\\u2019ll add the relevant details.<\\/p>\",\"text_columns\":\"1\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":21,\"sizes\":[]},\"typography_font_weight\":\"400\",\"scroll_y\":-80},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"0cc3614\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\"},\"elements\":[{\"id\":\"6b6a993\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":25.988,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[],\"isInner\":false},{\"id\":\"a31e426\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":47.687,\"column_sticky_offset\":50,\"scroll_y\":-80},\"elements\":[{\"id\":\"f45f58e\",\"elType\":\"widget\",\"settings\":{\"custom_php\":\"if (isset($_GET[\'product_id\'])) {\\r\\n    $product_id = intval($_GET[\'product_id\']);\\r\\n    echo do_shortcode(\'[vendor_form product_id=\' . $product_id . \']\');\\r\\n} else {\\r\\n    \\/\\/ Display product search form\\r\\n    if (isset($_GET[\'product_search\'])) {\\r\\n        $product_search = sanitize_text_field($_GET[\'product_search\']);\\r\\n        $products = new WP_Query(array(\\r\\n            \'post_type\' => \'product\',\\r\\n            \'s\' => $product_search,\\r\\n            \'posts_per_page\' => -1,\\r\\n        ));\\r\\n\\r\\n        if ($products->have_posts()) {\\r\\n            while ($products->have_posts()) : $products->the_post();\\r\\n                $product_id = get_the_ID();