(16104, 1, '2023-05-20 18:39:25', '2023-05-20 18:39:25', '<p>Selling with Celr is simple. Just begin typing below and we’ll add the relevant details.</p>		\n			<!-- Dynamic PHP Raw -->		\n			<style>/*! elementor - v3.13.2 - 11-05-2023 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>\">\">HOW IT WORKS</h2>		\n						<link rel=\"stylesheet\" id=\"wd-text-block-css\" href=\"http://localhost:8080/celr/wp-content/themes/woodmart/woodmart/css/parts/el-text-block.min.css?ver=7.2.3\" type=\"text/css\" media=\"all\" /> 					\n			1\n			<style>/*! elementor - v3.13.2 - 11-05-2023 */\n.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}.e-con{--container-widget-width:100%}.e-con-inner>.elementor-widget-spacer,.e-con>.elementor-widget-spacer{width:var(--container-widget-width,var(--spacer-size));--align-self:var(--container-widget-align-self,initial);--flex-shrink:0}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container,.e-con-inner>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer,.e-con>.elementor-widget-spacer>.elementor-widget-container,.e-con>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer{height:100%}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer>.elementor-spacer-inner,.e-con>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer>.elementor-spacer-inner{height:var(--container-widget-height,var(--spacer-size))}</style>		\n			<p>Pick your price based on our market-leading data.</p>\n			<p>2</p>\n			<p>Upload your wines with 3 simple clicks.</p>\n			<p>3</p>\n			<p>When your wine sells, transfer ownership and get paid.</p>\n			<h2>FAQ</h2>		\n			<h4>How much will selling with Celr cost me?</h4><p>We take no commission on any sales. The only cost when selling comes from transaction fees and transfer fees incurred when transferring ownership between bonded warehouses. This will vary depending on which warehouse you and the seller use, but is generally around £15 per case. See more on transfer prices here.</p><p>Transaction fees are 1.2% + 20p.</p><h4>Can I sell any wine with Celr?</h4><p>All wine sold on the Celr platform must be in-bond. This is to ensure condition and provenance for the buyer, and add conformity to the pricing.</p><h4>Can I set my own price?</h4><p>Celr provides a market price - this is a guideline price based on what the wine has sold for recently. We will also let you know what the lowest live offer for your wine is. You can then decide how much you would like to list for. We don’t allow listings of 10% above market price.</p><h4>What happens when my wine sells?</h4><p>We’ll notify you by email. The money is held by us for 15 days, during which time you will need to process the change of ownership with your warehouse provider. Once the buyer has confirmed receipt of ownership, we will release the money to you.</p>', 'Add Listing', '', 'inherit', 'closed', 'closed', '', '16060-revision-v1', '', '', '2023-05-20 18:39:25', '2023-05-20 18:39:25', '', 16060, 'http://localhost:8080/celr/?p=16104', 0, 'revision', '', 0),
