ntainer>.elementor-spacer{height:100%}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer>.elementor-spacer-inner,.e-con>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer>.elementor-spacer-inner{height:var(--container-widget-height,var(--spacer-size))}</style>		\n			<p>Pick your price based on our market-leading data.</p>\n			<p>2</p>\n			<p>Upload your wines with 3 simple clicks.</p>\n			<p>3</p>\n			<p>When your wine sells, transfer ownership and get paid.</p>\n			<h2>FAQ</h2>		\n			<h4>How much will selling with Celr cost me?</h4><p>We take no commission on any sales. The only cost when selling comes from transaction fees and transfer fees incurred when transferring ownership between bonded warehouses. This will vary depending on which warehouse you and the seller use, but is generally around £15 per case. See more on transfer prices here.</p><p>Transaction fees are 1.2% + 20p.</p><h4>Can I sell any wine with Celr?</h4><p>All wine sold on the Celr platform must be in-bond. This is to ensure condition and provenance for the buyer, and add conformity to the pricing.</p><h4>Can I set my own price?</h4><p>Celr provides a market price - this is a guideline price based on what the wine has sold for recently. We will also let you know what the lowest live offer for your wine is. You can then decide how much you would like to list for. We don’t allow listings of 10% above market price.</p><h4>What happens when my wine sells?</h4><p>We’ll notify you by email. The money is held by us for 15 days, during which time you will need to process the change of ownership with your warehouse provider. Once the buyer has confirmed receipt of ownership, we will release the money to you.</p>', 'Add Listing', '', 'inherit', 'closed', 'closed', '', '16060-revision-v1', '', '', '2023-05-20 18:39:24', '2023-05-20 18:39:24', '', 16060, 'http://localhost:8080/celr/?p=16103', 0, 'revision', '', 0),
