(63, 'payoneer_q2_2023', 'marketing', 'en_US', 'Grow with the next generation of payment processing', 'Ready to stand out in the new global economy? Payoneer Checkout gives you the power to securely accept payments worldwide, build a checkout that customers love, and manage your store’s transactions and finances – all from the same place.', '{}', 'pending', 'woocommerce.com', '2023-05-18 16:06:39', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'ipp_refresh_q2_2023_us_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the M2 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'unactioned', 'woocommerce.com', '2023-05-18 19:41:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'ipp_refresh_q2_2023_ca_inbox_notification', 'marketing', 'en_US', 'Grow on the go with in-person payments', 'Sell your products or services on the go with the WisePad 3 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.', '{}', 'pending', 'woocommerce.com', '2023-05-18 16:06:39', NULL, 0, 'plain', '', 0, 0, 'info'),
(66, 'product_management_card_sorting', 'survey', 'en_US', 'How do you create and edit products?', 'Have a say in the future of WooCommerce. Take part in a brief exercise and help us understand what information is important to you while editing products.', '{}', 'unactioned', 'woocommerce.com', '2023-05-18 18:24:01', NULL, 0, 'plain', '', 0, 1, 'info'),
(67, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-19 20:22:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-19 20:22:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-20 17:25:57', NULL, 0, 'plain', '', 0, 0, 'info');
